"use strict";

var dom = document.querySelectorAll("img");

var timg = [
    "data:image/gif;base64,",
    "data:image/png;base64,"
];

console.log("图像统计：" + dom.length);

let origin_src = new Array();

dom.forEach(
    function (item) {
        let key = Math.random(0, 100);
        origin_src[key] = item.src;
        item.src = timg[0];
        item.setAttribute('class', "thumbnails");

        if (origin_src[key].search("media-fs.huahuo-cn.tk") != -1) {
            console.log("创建XHR请求");
            var xhr = new XMLHttpRequest();
            xhr.open("GET", origin_src[key], true);
            xhr.responseType = "blob";
            xhr.send();
            xhr.onreadystatechange = function () {
                if (xhr.readyState == 4) {
                    if (xhr.status == 200) {
                        try {
                            var bloburl = URL.createObjectURL(this.response);
                            item.src = bloburl;
                            console.log(bloburl);
                            item.setAttribute('class', "complete", "thumbnails");
                        } catch (e) {
                            item.src = origin_src[key];
                            item.setAttribute('class', "complete", "thumbnails");
                            throw e;
                        }
                    } else {
                        console.log("请求失败，响应码：" + xhr.status);
                        item.src = timg[1];
                        item.setAttribute('class', "complete", "thumbnails");
                    }
                }
            }
        }
    }
);